  input: "\"TEXT\",\"F3XN\",\"C00140590\",\"February 20, 2006\t\t      Katrina Senger
    \ Federal Elections Commission    RE:  California Republican Party           FEC
    ID#  C00140590           January Monthly Report (01/01/06-01/31/06)    Dear Katrina
    Senger,    Please be advised that the committee is paying for its voter registration
    expenses in the following manner as previously directed by the Federal Elections
    Commission.  The committee pays the federal share directly out of the federal
    account and pays the nonfederal or Levin share directly out of the nonfederal
    or Levin account.    The committee is aware of the types of activity that must
    be reported on Line 30(b) as FEA.  Please note that none of the activity on Line
    21(b) or on the H4 schedule is FEA or contains express advocacy.  The committee
    is also aware that certain public communications must be reported if a federal
    candidate is identified.  Since the committee controller and treasurer review
    all expenditures and their classifications, please be advised that if there is
    an expenditure that is identified as FEA, it is paid and reported accordingly
    in the correct manner.     The corrective transfer on Line 22 of Schedule B is
    in reference to the voided check that was reported on the H4 of the December Year
    End Report.    In regard to occupation and employer information requested, a letter
    is sent to those donors whose contributions exceed $200, but did not provide us
    with their employer and occupation on our initial contribution solicitation which
    sites the FEC regulation for the requested information.  The committees policy
    is to send a follow-up letter within thirty days of the original contribution
    to request this information with a pre-addressed envelop enclosed for the return
    of such information.  All such information received is reported accordingly.  If
    information is received after the reporting deadline, the committee will amend
    the appropriate monthly report.      Sincerely,     Doug Boyd  California Republican
    Party\""
